import styled from 'styled-components';

export const StyledNav = styled.nav`
  display: flex;
  align-items: center;
  justify-content: space-between;
  background: #141414;

  color: #e5e5e5;
  font-size: 14px;

  padding: 20px 50px;
`;

export const NavLeft = styled.div`
  display: flex;
  align-items: center;

  img {
    height: 25px;
  }

  span {
    cursor: pointer;
    margin: 0px 4px;
  }
`;

export const NavRight = styled.div`
  display: flex;
  align-items: center;

  img {
    height: 30px;
    border-radius: 5px;
  }
`;
